var title_f5_56_6022="N-serrated pattern on direct immunofluorescence";
var content_f5_56_6022=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F86951&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F86951&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 596px\">",
"   <div class=\"ttl\">",
"    N-serrated pattern of IgG basement membrane zone antibody staining in bullous pemphigoid by direct immunofluorescence microscopy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 576px; height: 434px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The positive direct immunofluorescence staining along the basement membrane zone in this section of a perilesional skin specimen demonstrates what is described as an n-serrated linear pattern interspersed with segments of true linear IgG basement membrane zone antibody reactivity. This pattern is associated with bullous pemphigoid, mucous membrane pemphigoid, anti-laminin gamma-1 pemphigoid, and linear IgA bullous dermatosis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kristin M Leiferman, MD, Immunodermatology Laboratory, Department of Dermatology, University of Utah, Salt Lake City, Utah.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
