var title_f5_56_6029="Laxatives for children";
var content_f5_56_6029=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F63381&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F63381&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Starting doses of laxatives for functional constipation in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Osmotic and lubricant laxatives",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Laxative",
"       </td>",
"       <td class=\"subtitle2\">",
"        Dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        Polyethylene glycol 3350 powder (Miralax&reg;)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Children",
"       </td>",
"       <td>",
"        0.4 to 0.8 gm/kg/day (up to 1.5 gm/kg per day has been useful in some cases*)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Adults",
"       </td>",
"       <td class=\"sublist_other_start\">",
"        17 gm of powder per day, in 8 ounces of water",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3_start\" colspan=\"2\">",
"        Current clinical practice:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        Younger than 18 months",
"       </td>",
"       <td class=\"sublist_other\">",
"        0.5 to 1 teaspoon once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        18 months to 3 years",
"       </td>",
"       <td class=\"sublist_other\">",
"        2 to 3 teaspoons once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        Older than 3 years",
"       </td>",
"       <td class=\"sublist_other\">",
"        2 to 4 teaspoons once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        Lactulose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Children",
"       </td>",
"       <td>",
"        1 mL/kg (up to adult dose),&nbsp;once or twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Adults",
"       </td>",
"       <td>",
"        15 to 30 mL, once daily (maximum 60 mL/day)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        Sorbitol (syrup, 70 percent solution)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 to 11 years old",
"       </td>",
"       <td>",
"        1 mL/kg,&nbsp;once or twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        12 years to adults",
"       </td>",
"       <td>",
"        15 to 30 mL,&nbsp;once or twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\">",
"        Mineral oil",
"       </td>",
"       <td>",
"        1 to 3 mL/kg, once daily (Caution: Should not be used in individuals at risk for aspiration,&nbsp;including&nbsp;infants, neurologically impaired children,&nbsp;or&nbsp;patients with marked&nbsp;gastroesophageal reflux)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\">",
"        Magnesium hydroxide (milk of magnesia)",
"       </td>",
"       <td>",
"        1 to 2 mL/kg, once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Stimulant laxatives",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Laxative",
"       </td>",
"       <td class=\"subtitle2\">",
"        Dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        Senna (syrup, 8.8 mg sennosides/5 mL OR Tablets 8.6 mg sennosides/tab)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1 to 2 years old",
"       </td>",
"       <td>",
"        1.25 to 2.5 mL,&nbsp;once or twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2 to 6 years old",
"       </td>",
"       <td>",
"        2.5 to 3.75 mL,&nbsp;once or twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        6 to 12 years old",
"       </td>",
"       <td>",
"        5 to 7.5 mL (or 1 to 2 tabs),&nbsp;once or twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        12 years and older",
"       </td>",
"       <td>",
"        1 to 2 tabs,&nbsp;once or twice daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"2\">",
"        Bisacodyl (10 mg suppositories OR 5 mg tablets)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2 to 12 years old",
"       </td>",
"       <td>",
"        1/2 to 1 suppository (OR 1 to 2 tablets), once daily",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        12 years to adult",
"       </td>",
"       <td>",
"        1 to 3 tablets (OR 1 suppository), once daily",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Pashankar DS, Bishop WP. Efficacy and optimal dose of daily polyethylene glycol 3350 for treatment of constipation and encopresis in children. J Pediatr 2001; 139:428.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
